common:
  api_name: logging
  api_version: v2
  organization_name: google-cloud
  service_yaml: logging.yaml
  gapic_yaml: v2/logging_gapic.yaml
  src_proto_paths:
  - v2
  proto_deps:
  - name: google-common-protos
artifacts:
- name: java_gapic
  type: GAPIC
  language: JAVA
  release_level: BETA
- name: python_gapic
  type: GAPIC
  language: PYTHON
  release_level: BETA
  package_version:
    grpc_dep_lower_bound: 0.91.4
    grpc_dep_upper_bound: 0.92dev
- name: php_gapic
  type: GAPIC
  language: PHP
- name: ruby_gapic
  type: GAPIC
  language: RUBY
- name: go_gapic
  type: GAPIC
  language: GO
- name: csharp_gapic
  type: GAPIC
  language: CSHARP
- name: nodejs_gapic
  type: GAPIC
  language: NODEJS
- name: gapic_config
  type: GAPIC_CONFIG
